INSERT INTO `recipes` (`id`, `name`, `description`, `picture_link`, `time`, `introduction`) VALUES
(1, 'Gordon Ramsay Omelette', 'Heat the f*cking butter in a f*cking omelette pan.\r\nF*cking break the f*cking eggs into a f*cking bowl.\r\nF*cking whisk the f*ckers and add some f*cking salt and f*cking pepper to taste.\r\nWhen the f*cking butter is hot, add the f*cking mixture to the pan.\r\nWhen cooked take the f*cking thig out\r\nEat the f*cker.', 'GordonRamsayOmelette.jpg', 5, 'Try this f*cking omelette for brunch or serve with f*cking green salad for a quick and f*cking satisfying dinner.'),
(2, 'Juustuburger', 'Sega sool ja pipar hakkliha hulka ning vormi saadud segust neli suurt pätsi, grilli või prae need küpseks (9 minutit kummaltki poolt). Aseta teise poole küpsemise ajaks juustuviilud lihapätside peale. Lao ainetest kokku võileib.', 'Juustuburger.jpg', 20, 'Nagu nimigi ütleb, on juustuburgeris peale hakkliha ka juustu, mis tavaliselt esineb toeka, vähemalt veerand tolli ehk 6 mm paksuse viiluna.'),
(3, 'Ahjuliha', '1.  Määri liha mõlemad pooled võiga kokku.\r\n2.  Mõlemale poole puista maitseainesegu, nii et liha oleks seguga mõlemalt poolt kaetud.\r\n3.  Aseta liha küpsetuskotti ja pane liha pealmisele poolele värske tüümianioks.\r\n4.  Sulge kotisuu ja küpseta liha 150 kraadi juures umbes poolteist tundi.\r\n# Kui soovid liha kõrvale ka kastet, on kindla peale minek seene- ja sinepikaste.\r\n# Maitseainesegu on lihtne variant, kusjuures jahimehesegu aitab iga lihatoidu hädast välja. Samas võid maitsesegu ka ise kokku miksida, siis vajad paprikapulbrit, sinepiseemneid, sibulahelbeid, köömneid ja musta pipart.', 'Ahjuliha.jpg', 120, 'Kerge serveerida, kuna ei vaja enam tükeldamist. Eriti maitsev tuleb, kui liha on pekiga läbi kasvanud, siis ei kuiva see ahjus ära.'),
(4, 'Ahjukartulid sinihallitusjuustuga', 'Keeda pestud kartuleid umbes 20 minutit, lõika pooleks, võta sisu lusikaga välja ja täida siis kohupiima, sinihallitusjuustu või rohelise sibula seguga. Pane kartulida ahju küpsema, määri enne pealt sulavõiga ja raputa peale meresoola.', 'AhjukartulidSinihallitusjuustuga.jpg', 40, 'Mõnus soe lisand küpsetatud või praetud liharoogadele.\r\n'),
(5, 'Waldorfi Pasta', '1.  Juustukastme tegemiseks lase piim koos vahukoorega keema ja keeda segades madalal kuumusel 5 minutit. Lõika juust tükikesteks, pane 50 g sellest kuuma piima sisse sulama ja keeda madalal kuumusel 5 minutit.\r\n\r\n2. Haki jõhvikad ja pähklid jämedalt. Puhasta seller, eemalda lehed ja kiud ning lõika varred diagonaalselt õhukesteks viiludeks. Lõika pirnid neljaks sektoriks, eemalda seemnekoda ja lõika pikuti õhukesteks viiludeks.\r\n\r\n3. Sega seller ja pirn ning nirista tumenemise vältimiseks peale 1 sl sidrunimahla. Sega läbi.\r\n\r\n4. Keeda pasta al dente.\r\n\r\n5. Lisa juustukastmele hakitud jõhvikad. Maitsesta kaste soola, pipra ja 0,5 sl sidrunimahlaga. Nõruta pasta ning sega kohe hulka selleri- ja pirniviilud. Nirista üle kastmega ning puista peale jõhvikad, pähklid ja ülejäänud juustutükikesed. Kaunista sellerilehtedega ja serveeri.', 'WaldorfiPasta.jpg', 30, 'Pisut peenem maitseelamus romantiliseks õhtusöögiks. Tugevamaitseline sinihallitusjuust, koorene pasta, kuivatatud jõhvikad ja kreeka pähklid annavad kokku hõrgu roa.'),
(6, 'Pizza Margherita', '1. Pane jahu lauale kuhja. Lahusta pärm ja suhkur 150 ml soojas vees, sega hoolega ning vala jahukuhja keskele tehtud õõnsusse. Sõtku, kuni saad ühtlase taina.\r\n\r\n2. Lahusta sool 150 ml soojas vees ja lisa tainale. Sõtku ja lisa osade kaupa ülejäänud vesi ja oliiviõli, vajadusel lisa veel jahu, kuni saad pehme taina, mis ei jää käte külge kinni. Vormi suur tainapall ja pane jahuga ülepuistatud kaussi. Kata köögirätikuga ja pane ööpäevaks külmkappi seisma (umbes 4 plusskraadi juurde).\r\n\r\n3. Vormi tainast 4 palli ja siis vormi need pitsapõhjadeks, nii et keskmise osa paksus on maksimaalselt 0,5 cm ja äärte paksus 2 cm.\r\n\r\n4. Sega tomatipasta 7 sl oliiviõli ja soolaga ning määri pitsapõhjadele. Puista peale basiilik ja riivitud või viiludeks lõigatud mozzarella ning pane eelkuumutatud ahju.\r\n\r\n5. Küpseta pitsat puuahjus umbes 400° juures 1,5 minutit, elektriahjus 250° kraadi juures 15 minutit. Vala ahjuplaadile oliiviõli, et pitsapõhi ei jääks plaadile kinni. Pärast ahjust võtmist kalla pitsale peale tiir oliiviõli ja serveeri kohe!\r\n', 'PizzaMargherita.jpg', 60, 'Pitsa sobib väikesteks viiludeks lõigatuna ka aperitiivisuupisteks. '),
(7, 'Tatrapuder hakklihaga', 'Pruunista hakkliha pannil õlis, siis lisa riivitud porgand ja hakitud sibul, maitsesesta soola ja pipraga ning kuumuta läbi.\r\n\r\nKuumuta tatar potis väheses õlis kergelt kuldseks (umbes 5 minutit). Lisa praetud hakkliha-sibula-porgandi segu ning seejärel lisa keev vesi. Kata pott kaanega ning hauta tasasel tulel 30-40 minutit, kuni tatar on pehme.\r\n\r\nServeeri hapukurgi ja külma kastmega.', 'TatrapuderHakklihaga.jpg', 60, 'Tatrapuder sobib nii iseseisvaks õhtusöögiks kui ka liha ja kala kõrvale.');
